import React from 'react';
import Video from './Video';
import './app.css';


function App() {
  return (
    <div className="app">
      <div className="app__videoContainer">
        <Video videoSrc="https://v16m.tiktokcdn.com/dc17b984d6e4dd2fcea5250bbcda4a1c/5f44aa41/video/tos/useast2a/tos-useast2a-pve-0068/4e85a974822e46bdb878fbd6b3c102ef/?a=1233&br=2662&bt=1331&cr=0&cs=0&dr=0&ds=3&er=&l=202008230605530101890711490203A73A&lr=tiktok_m&mime_type=video_mp4&qs=0&rc=M2hueHY1bjk4dTMzZjczM0ApNDpkZGY8NmRoNzY6Mzc0OWdfMW1rZDNlYDVfLS0xMTZzcy8tYTZiLTQwYDViMzExNjA6Yw%3D%3D&vl=&vr="/>
      </div>
      <div className="app__videoContainer">
        <Video videoSrc="https://v16m.tiktokcdn.com/dc17b984d6e4dd2fcea5250bbcda4a1c/5f44aa41/video/tos/useast2a/tos-useast2a-pve-0068/4e85a974822e46bdb878fbd6b3c102ef/?a=1233&br=2662&bt=1331&cr=0&cs=0&dr=0&ds=3&er=&l=202008230605530101890711490203A73A&lr=tiktok_m&mime_type=video_mp4&qs=0&rc=M2hueHY1bjk4dTMzZjczM0ApNDpkZGY8NmRoNzY6Mzc0OWdfMW1rZDNlYDVfLS0xMTZzcy8tYTZiLTQwYDViMzExNjA6Yw%3D%3D&vl=&vr="/>
      </div>
    </div>
  );
}

export default App;
